import { Cell } from "./DayStyle"
import { Row } from "./DayStyle"
import { Day } from "./DayStyle"
import { CurrentDay } from "./DayStyle"

const isCurrentDay = ((day, currentDay) => day === currentDay);
const getDay = ((day) => {day.format('D')});


export function DaySell({day, currentDay}) {
    return (
        <Cell
            weekend={day.day() === 6 || day.day() === 0}
        >
            <Row
                justify={'flex-end'}
            >
                <Day>
                    {isCurrentDay(day, currentDay) ? (<CurrentDay>{getDay(day)}</CurrentDay>) : getDay(day)}
                    {/* {day.format('D')} */}
                </Day>
            </Row>
        </Cell>
    )
}
